// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;
pragma experimental ABIEncoderV2;

import "./Verifiers.sol";
import "./MinAgeVerifier.sol";

contract Voting {
	mapping(uint256 => uint256) votes;
	Verifiers verifiers;

	constructor(Verifiers _verifiers) public {
		verifiers = _verifiers;
	}

	function vote(uint256 _vote, MinAgeVerifier.Proof memory _proof, uint[2] memory _input) public returns (address addr, uint[2] memory input, MinAgeVerifier.Proof memory proof, bool _isValid, bool _isAdult, bool _success, uint256 diff, uint256 yrs18Ago) {
		yrs18Ago = block.timestamp - (365 days * 18);

		diff = (_input[0] > yrs18Ago ? _input[0] - yrs18Ago : yrs18Ago - _input[0]);

		_isValid = diff < 5 * 60 * 60 * 24; // make sure the comparison timestamp is actually 18 years ago (+- 5 days for longer Februaries)

		MinAgeVerifier minAgeVerifier = MinAgeVerifier(verifiers.minAgeVerifier.address);
		addr = verifiers.minAgeVerifier.address;

		proof = _proof;
		input = _input;

		_isAdult = minAgeVerifier.verifyTx();

		if(_isValid && _isAdult) {
			votes[_vote]++;
			_success = true;
		}
	}
}
